import React, { useEffect, useState } from 'react';

const TableData = () => {


    const [show, setShow] = useState(false);
    const [users, setUser] = useState([{}]);
    const [showIt, setShowIt] = useState(false);
    const [usersIt, setUserIt] = useState("");
    const [user,setUs] =useState({subject:"",text:"",password:"",cpassword:"",tyUser:"",AdminEmail:""});

    
    const se=(e)=>{
        setUserIt(e.target.name);
        setShowIt(true);

    }
    const ch=(e)=>{
        alert(e.target.name);
        e.target.className="btn btn-dark";
    }

    const sub=()=>{

    }
    useEffect(() => {

        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
                setUser(data);
                setShow(true);
            })
    }, []);

    return (

        <>
           
                <center>
            <h1>
                {show && 
                <h1>
                    <>

                    {
                        Object.keys(users).map((key, i) => (
                            
                            <button onClick={se} className="btn btn-primary" name={key} style={{"margin":"15px"}}>
                                
                                {key}
                                </button>
                        ))
                            
                    }

                        {
                            showIt && 

                            <>
                            <br/>
                            {
                                    Object.keys(usersIt).map((keys,i)=>(
                                        <button name={usersIt}className="btn btn-light"  style={{"margin":"10px"}} onClick={ch}>{users[usersIt][i]}</button>
                                        ))           
                                    }
                            
                            </>
                        }
                    <div className='container'>


                    <form action="/sign" method ="post">
        <div class="mb-3 mt-3" method="post">
          <label for="subject" class="form-label">Subject:</label>
          <input value={user.subject} type="text" style={{"text-align": "center"}} class="form-control" id="email"  placeholder="Enter Subject" name="subject"/>
        </div>
        <div class="mb-3">
          <label for="text" class="form-label">Text:</label>
          <input value={user.text} type="text" style={{"text-align": "center"}} class="form-control" id="pwd"  placeholder="Enter text" name="text"/>
        </div>
        <div class="mb-3">
          <label for="html" class="form-label">Html:</label>
          <input value={user.html} type="text" style={{"text-align": "center"}} class="form-control" id="pwd"   placeholder="Enter html" name="html"/>
        </div>
        <button type="submit" onClick={sub} class="btn btn-primary">Submit</button>
      </form>
     

                    </div>

                    </>
                </h1>
                }

            </h1>
                </center>
        </>
    );
};

export default TableData;
